description:
We traveled to Colombia for a little r&amp;r and asoon as we landed we met a really nice waitress named Camila. She was a beautiful, dark skinned brunette with a slamming body and an attraction to foreigners. We were in the right place at the right time cuz it didn't take us long to bring her back to the hotel to make us some breakfast. We had other things in mind like having her for breakfast and so we did and the world felt a little better. Que viva Colombia!!


